import { BrowserRouter, Route, Switch } from 'react-router-dom'
import React from 'react'
import { Landing } from './screens/Landing'

export default function Routes() {
    return (
        <BrowserRouter>
            <Switch>
              <Route exact path="/" component={Landing}/>
            </Switch> 
        </BrowserRouter>
    )
}
